                  </tr>
              </thead>
              <tbody>
                  {data.map(item => (
                  <tr key={item.id}>
                      <td>{item.id}</td>
                      <td>{item.name}</td>
                  </tr>
                  ))}
              </tbody>
              </table>
          </body>
      </html>
    );*/

    return (
        <Router>
            <div>
                <header>
                    <Link to="/">Home</Link>
                    <Link to="/recipe"></Link>
                </header>
                <main>
                    <Route exact path="/" component="[HomePage]" />
                    <Route path="/recipe" component="[RecipePage]" />
                </main>
            </div>
        </Router>
    );
}

export default App;
